import React from 'react'

import Container from 'react-bootstrap/Container'
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'

//contentType defines which content will be inside the component
const text='text'   //text only. like formatted info etc

//
export default class contentPage extends React.Component{
    constructor(props){
        super(props)
        
        this.state={
            type: text
        }
    }

    render(){
        return(
            <Container>
                <Row style="height:100vh;">
                    <Col xs={0} md={3}></Col>
                    <Col xs={12} md={6} className="h-100 mainContent">

                    </Col>
                    <Col xs={0} md={3}></Col>
                </Row>
            </Container>
        )
    }
}
